    public function getSourceContext()
    {
        return new Source("{% extends 'base.html.twig' %}

{% block title %}Liste des employés{% endblock %}

{% block body %}
    <h1>Liste des employés</h1>

    <a href=\"{{ path('generate_pdf') }}\" class=\"btn btn-primary\">Télécharger la liste en PDF</a>
    <a href=\"{{ path('app_user_new') }}\" class=\"btn btn-primary\">Nouveau  employé</a>

    <div class=\"card-body\">
        <div class=\"dt-responsive\">
            <input type=\"text\" id=\"search\" placeholder=\"Rechercher dans le tableau...\" class=\"form-control mb-3\">
            <table id=\"dom-jqry\" class=\"table table-striped table-bordered nowrap\">
                <thead>
                    <tr>
                        <th>Id</th>
                        <th>Email</th>
                        <th>Roles</th>
                        <th>FirstName</th>
                        <th>LastName</th>
                        <th>DateBirth</th>
                        <th>Phone</th>
                        <th>Address</th>
                        <th>actions</th>
                    </tr>
                </thead>
                <tbody>
                {% for user in users %}
                    <tr>
                        <td>{{ user.id }}</td>
                        <td>{{ user.email }}</td>
                        <td>{{ user.roles ? user.roles|json_encode : '' }}</td>
                        <td>{{ user.firstName }}</td>
                        <td>{{ user.lastName }}</td>
                        <td>{{ user.dateBirth ? user.dateBirth|date('Y-m-d') : '' }}</td>
                        <td>{{ user.Phone }}</td>
                        <td>{{ user.Address }}</td>
                        <td>
                            <a href=\"{{ path('app_user_show', {'id': user.id}) }}\">show</a>
                        </td>
                    </tr>
                {% else %}
                    <tr>
                        <td colspan=\"13\">no records found</td>
                    </tr>
                {% endfor %}
                </tbody>
            </table>
        </div>
    </div>
{% endblock %}
{% block javascripts %}
    <script src=\"https://code.jquery.com/jquery-3.6.0.min.js\"></script>
    <script>
        \$(document).ready(function(){
            \$(\"#search\").on(\"keyup\", function() {
                var value = \$(this).val().toLowerCase();
                \$(\"#dom-jqry tbody tr\").filter(function() {
                    \$(this).toggle(\$(this).text().toLowerCase().indexOf(value) > -1)
                });
            });
        });
    </script>
{% endblock %}", "user/index.html.twig", "/Users/hantour/Documents/FERIEL/template_dashboard/templates/user/index.html.twig");
